import React, { Fragment, lazy, Suspense } from 'react';
import { Routes, Route } from "react-router-dom";
import Layout from './Layout';

const Dashboard = lazy(() => import('./Containers/Dashboard'));

const App = () => {
  return (
    <Fragment>
      <Routes>
        <Route element={<Layout />}>
          <Route
            path="/" 
            element={
              <Suspense fallback={<>...</>}>
                <Dashboard />
              </Suspense>
            }
          />
        </Route>
      </Routes>
    </Fragment>
  )
}

export default App;
